        selectedTimeframe: "daily",
        setSelectedTimeframe: ()=>{ console.log("hello")},
    }
    return (
        <TimeframeContext.Provider value={timeframeContext}>
            {props.children}
        </TimeframeContext.Provider>
    )
}

